export default function PortfolioCard(props) {
    const color='bg-secondary'
    return (

        <div className="col col-4 card  text-light m-3" style={{width: '23rem', backgroundColor: "white"}}>
            <div className="card-body text-center">
               <h5 className="card-title">{props.portfolios.name}</h5>
               <p className="card-text">Some quick example text to build on the card title.</p><hr/>
            </div>
        </div>
    );
  }
